import React, {Component} from 'react';
import './App.css';

class App extends Component {

  checkHTML(){
    let formData = new FormData(this.form);
    let text = formData.get('input')
    console.log(text)
    return text;
  }

  render(){
    return (
      <div className="App">
        <form id="form" onSubmit={this.checkHTML()} ref={(el) => {this.form = el}}>
          <textarea name="" id="input" cols="30" rows="10"></textarea>
          <button type="submit">Submit</button>
        </form>
      </div>
    );
  }
}

export default App;
